import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import TodoStore from './TodoStore';

class App extends Component {
  render() {
    const appName = "TodoList";
    return (
      <div className="App">
        <h1>{appName}</h1>
        <TodoStore />
      </div>
    )
  }
}

export default App;
